import React from 'react'
import { useMemo, useState } from 'react'
import { useTable } from 'react-table'
import 'bootstrap/dist/css/bootstrap.min.css'

export const AppletTable = () => {

  const columns = useMemo(() => [
    {
      Header: 'Name',
      accessor: 'name'
    },
    {
      Header: 'E-mail',
      accessor: 'email'
    },
    {
      Header: 'Admin',
      accessor: 'admin'
    }
  ], []);

  const [users, setUsers] = useState([{name: "Huda", email: "huda@gmail.com", admin: "Yes"}]);

  return (
    <div className='table-container'>
      <table className='table'>
        <thead className='table-light'>
          <tr>
            <th>Name</th>
            <th>E-mail</th>
            <th>isAdmin</th>
          </tr>
        </thead>
        <tbody>
          {
            users.map(user => {
              return (
                <tr>
                  <td>user.name</td>
                  <td>user.email</td>
                  <td>user.admin</td>
                </tr>
              )
            })
          }
        </tbody>
      </table>
    </div>
  )
}
